def find_xmas(wordsearch):
    wordsearch = wordsearch.split("\n")
    total = 0

    for rowindex, row in enumerate(wordsearch):
        total += row.count("XMAS")
        total += row.count("SAMX")

        for index in range(len(row)):
            if row[index] == "X" and rowindex+3 < len(wordsearch):
                if (wordsearch[rowindex+1][index] == "M"
                    and wordsearch[rowindex+2][index] == "A"
                    and wordsearch[rowindex+3][index] == "S"):
                    total += 1
                if (index+3 < len(row)
                    and wordsearch[rowindex+1][index+1] == "M"
                    and wordsearch[rowindex+2][index+2] == "A"
                    and wordsearch[rowindex+3][index+3] == "S"):
                    total += 1
                if (index-3 >= 0
                    and wordsearch[rowindex+1][index-1] == "M"
                    and wordsearch[rowindex+2][index-2] == "A"
                    and wordsearch[rowindex+3][index-3] == "S"):
                    total += 1
            if row[index] == "S" and rowindex+3 < len(wordsearch):
                if (wordsearch[rowindex+1][index] == "A"
                    and wordsearch[rowindex+2][index] == "M"
                    and wordsearch[rowindex+3][index] == "X"):
                    total += 1
                if (index+3 < len(row)
                    and wordsearch[rowindex+1][index+1] == "A"
                    and wordsearch[rowindex+2][index+2] == "M"
                    and wordsearch[rowindex+3][index+3] == "X"):
                    total += 1
                if (index-3 >= 0
                    and wordsearch[rowindex+1][index-1] == "A"
                    and wordsearch[rowindex+2][index-2] == "M"
                    and wordsearch[rowindex+3][index-3] == "X"):
                    total += 1

    return total


